import React, { useState, useEffect } from "react";
import MainHeader from "./headertt";
import ModulePlaces from "./moduleplaces";


function Tolima() {

    const url = 'http://localhost:8000/place_activities.json'
    const [list_places, setPlaces] = useState([]);
    const fetchData = async () => {
        const response = await fetch(url);
        const data = await response.json();
        setPlaces(data.results);
    };

    useEffect(() => {
        fetchData();
    }, []);

    let list_places_tolima = [];

    for (let i = 0; i < list_places.length; i++) {
        if (list_places[i].department === "Tolima") {
            list_places_tolima.push(list_places[i]);
        }
    }
		return (
        <div>
            <MainHeader/>
            {list_places_tolima.map(places =>
                <ModulePlaces place={places.lugar}
                    calificacion={places.calificacion}
                    dpto={places.department}
                    mun={places.muni}
                    categoria={places.categoria}
                    img={places.img}
                    img2={places.img2}
                    descrip={places.description} />
            )}
        </div>
    )

}

export default Tolima;
